void insertion_sort(int A[], int n) {
	int i, j;
	int temp;
	
	for(i = 1; i < n; i++) {
		temp = A[i];
		j = i;
		while(j > 0 && A[j-1] > temp) {
			A[j] = A[j - 1];
			j--;
		}
		A[j] = temp;
	}
}

void print_array(int A[], int n) {
	int i = 0;
	putchar('[');
	while(i < n) {
		if(i > 0) printf(", ");
		printf("%d", A[i++]); //first A[i] is done then i = i + 1
	}
	puts("]");
}